import { FormControl, Input, InputLabel } from '@mui/material';
import './App.css';



function App() {

  const formInfo = {
    Name: {
      placeholder: 'Ramandeep Singh',
      type: 'text',
      id: 'name'
    },
    Email: {
      placeholder: 'example@gmail.com',
      type: 'email',
      id: 'email'
    },
    Mobile: {
      placeholder: '90******42',
      type: 'number',
      id: 'mobile'
    },
  }

  return (
    <div>
      {Object.keys(formInfo).map((info) => {
        return (
          <>
            <InputLabel htmlFor={formInfo[info].id}>{info}</InputLabel>
            <Input id={formInfo[info].id} type={formInfo[info].type} placeholder={formInfo[info].placeholder} />
          </>
        )
      })}


      <FormControl>
        <InputLabel htmlFor="my-input">Email address</InputLabel>
        <Input id="my-input" aria-describedby="my-helper-text" />
      </FormControl>
    </div>
  );
}

export default App;
